(()=>{var t=document.querySelector("#movie-thumbnail"),e=document.querySelector("#artist-thumbnail");(function(){fetch("movie/getMovies").then(t=>t.json()).then(e=>{let i=t.querySelector(".thumbnail-list> ul");e.movies.forEach(({movies_id:t,movies_title:e,movies_cover:o})=>{let l=`<img data-id=${t} src="images/${o}" alt="${e} cover" class="movie-thumbnail">`;i.innerHTML+=l})}).catch(function(t){console.log(t)})}).call(),function(){fetch("music/getArtists").then(t=>t.json()).then(t=>{let i=e.querySelector(".thumbnail-list > ul");t.movies.forEach(({artist_id:t,artist_name:e,artist_photo:o})=>{let l=`<img data-id=${t} src="images/${o}" alt="${e} cover" class="artist-thumbnail">`;i.innerHTML+=l})}).catch(function(t){console.log(t)})}.call()})();